import React from 'react';
import s from "./Dialogs.module.css"
import {NavLink} from "react-router-dom";



const DialogItem = (props)=>{
    return(
        <div className={s.dialog +' '+s.active}>
            <NavLink to={"/dialogs/"+props.id}>{props.name}</NavLink>
        </div>
    )
}
const Message = (props)=>{
    return(
        <div className={s.message}> Hello</div>
    )
}
const Dialogs = (props)=>{
    return(
            <div className={s.dialogs}>
                <div className={s.dialogsItems}>
                    <DialogItem name={"Andrey"} id={"1"}/>
                    <DialogItem name={"Alexandr"} id={"2"}/>
                    <DialogItem name={"Darya"} id={"3"}/>
                    <DialogItem name={"Ivan"} id={"4"}/>

                </div>
                <div className={s.dialogsMessage}>
                    <div className={s.message}> Hello</div>
                    <div className={s.message}> How are you, man?</div>
                    <div className={s.message}> What interestind in your life? </div>
                    <div className={s.message}> I'm glad to hear you! </div>
                </div>
            </div>

        // </div>
    )
}
export default Dialogs;
